Construct a [`Table`] from TOML syntax.

```rust
let cargo_toml = toml::toml! {
    [package]
    name = "toml"

    [dependencies]
    serde = "1.0"

    [dev-dependencies]
    serde_derive = "1.0"
    serde_json = "1.0"
};

println!("{:#?}", cargo_toml);
```

880.docs:
Deserializes a string into a type.

This function will attempt to interpret `s` as a TOML document and
deserialize `T` from the document.

To deserializes TOML values, instead of documents, see [`ValueDeserializer`].

# Examples

```
use serde::Deserialize;

#[derive(Deserialize)]
struct Config {
    title: String,
    owner: Owner,
}

#[derive(Deserialize)]
struct Owner {
    name: String,
}

let config: Config = toml::from_str(r#"
    title = 'TOML Example'

    [owner]
    name = 'Lisa'
"#).unwrap();

assert_eq!(config.title, "TOML Example");
assert_eq!(config.owner.name, "Lisa");
```

506.docs:
Deserialization implementation for TOML [values][crate::Value].

# Example

```
# #[cfg(feature = "parse")] {
# #[cfg(feature = "display")] {
use serde::Deserialize;

#[derive(Deserialize)]
struct Config {
    title: String,
    owner: Owner,
}

#[derive(Deserialize)]
struct Owner {
    name: String,
}

let value = r#"{ title = 'TOML Example', owner = { name = 'Lisa' } }"#;
let deserializer = toml::de::ValueDeserializer::parse(value).unwrap();
let config = Config::deserialize(deserializer).unwrap();
assert_eq!(config.title, "TOML Example");
assert_eq!(config.owner.name, "Lisa");
# }
# }
```

917.docs:
Serialization for TOML [values][crate::Value].

This structure implements serialization support for TOML to serialize an
arbitrary type to TOML. Note that the TOML format does not support all
datatypes in Rust, such as enums, tuples, and tuple structs. These types
will generate an error when serialized.

Currently a serializer always writes its output to an in-memory `String`,
which is passed in when creating the serializer itself.

# Examples

```
use serde::Serialize;

#[derive(Serialize)]
struct Config {
    database: Database,
}

#[derive(Serialize)]
struct Database {
    ip: String,
    port: Vec<u16>,
    connection_max: u32,
    enabled: bool,
}

let config = Config {
    database: Database {
        ip: "192.168.1.1".to_string(),
        port: vec![8001, 8002, 8003],
        connection_max: 5000,
        enabled: false,
    },
};

let mut value = String::new();
serde::Serialize::serialize(
    &config,
    toml::ser::ValueSerializer::new(&mut value)
).unwrap();
println!("{}", value)
```
